INSERT INTO `cms_master` VALUES ('1','TERMS OF WEBSITE USE','terms_conditions','<p>\r\nPlease read these terms of use carefully before you start to use the site. By using our site, you indicate that you accept these terms of use and that you agree to abide by them. If you do not agree to these terms of use, please refrain from using our site.\r\n</p>\r\n<p>\r\n<h4>Reliance On Information Posted & Disclaimer</h4>\r\nthe materials contained on our site are provided for general information purposes only and do not claim to be or constitute legal or other professional advice and shall not be relied upon as such.\r\nWe do not accept any responsibility for any loss which may arise from accessing or reliance on the information on this site and to the fullest extent permitted by English law, we exclude all liability for loss or damages direct or indirect arising from use of this site.\r\n</p>\r\n<p>\r\n<h4>Information about us</h4>\r\nwww.ticketbaby is a trading style registered in England and Wales under registration number 09014294 Our registered office 145 - 157 St John Street London EC1V 4PW\r\n</p>\r\n<p>\r\n<h4>Accessing our site</h4>\r\nAccess to our site is permitted on a temporary basis, and we reserve the right to withdraw or amend the service we provide on our site without notice (see below). We will not be liable if for any reason our site is unavailable at any time or for any period.\r\n</p>\r\n<p>\r\n<h4>Intellectual property rights</h4>\r\nWe are the owner or the licensee of all intellectual property rights in our site, and in the material published on it. Those works are protected by copyright laws and treaties around the world. All such rights are reserved.\r\nYou may print off one copy, and may download extracts, of any page(s) from our site for your personal reference and you may draw the attention of others within your organisation to material posted on our site.\r\nYou must not modify the paper or digital copies of any materials you have printed off or downloaded in any way, and you must not use any illustrations, photographs, video or audio sequences or any graphics separately from any accompanying text.<br/>\r\nOur status (and that of any identified contributors) as the authors of material on our site must always be acknowledged.\r\nYou must not use any part of the materials on our site for commercial purposes without obtaining a licence to do so from us or our licensors.<br/>\r\nIf you print off, copy or download any part of our site in breach of these terms of use, your right to use our site will cease immediately and you must, at our option, return or destroy any copies of the materials you have made.\r\n</p>\r\n<p>\r\n<h4>Our site changes regularly</h4>\r\nWe aim to update our site regularly, and may change the content at any time. If the need arises, we may suspend access to our site, or close it indefinitely. Any of the material on our site may be out of date at any given time, and we are under no obligation to update such material.\r\n</p>\r\n<p>\r\n<h4>Ticket Purchases </h4>\r\n<ol>\r\n<li>\r\nTickets are not refundable under any circumstances other than cancellation of the event or unless the event is moved to another date which prohibits you from attending (in some cases there will be a deadline for a refund request, if you do not meet this date then we cannot refund your tickets). In this instance the full value of the ticket less any booking fees and postage/credit card charges will be refunded. Please note that some tickets contain a hidden booking fee, so it appears as 0 to the customer. If you would like to know this fee before purchasing, please call the ticket information number.\r\n</li>\r\n<li>\r\nIf you pay a deposit on a ticket or table and miss the advertised deadline to pay the balance, your deposit will be void and no refund will be given.\r\n</li>\r\n<li>\r\nIn the event we act negligently, we will refund your full payment including any booking fees. These scenarios are extremely rare but comprise of:\r\n<ol>\r\n<li>Us sending the wrong order (we may need incorrect tickets returned before refunding)</li>\r\n<li>Us failing to send tickets as required nor arranging an alternative door collection</li>\r\n<li>Us sending tickets to the wrong address (except if you provide an incorrect address)</li>\r\n</ol>\r\n</li>\r\n<li>\r\nWe are unable to accept any liability or replace any tickets lost, stolen or damaged after they have been received by you.\r\n</li>\r\n<li>\r\nSpecial Delivery may be the only postage option available to you and this will usually be due to the event falling within a few days, thus requiring a swift delivery.\r\n</li>\r\n<li>\r\nThe Rules and Regulations of the venue and the event must be adhered to.\r\n</li>\r\n<li>\r\nAlthough we will do our best to keep you informed of any cancellation, it is the ticket holders\' responsibility to establish whether an event has been cancelled and the date and time of any rearranged event.\r\n</li>\r\n<li>\r\nVenue management reserve the right to refuse admission and may conduct security searches on entry. Should you be refused entry for any reason, including but not limiting to how you are dressed we are not liable to refund you for the ticket you have purchased.\r\n</li>\r\n<li>\r\nYou are advised to check if the venue has a last entry time. Even ticket holders may not be admitted after this time.\r\n</li>\r\n<li>\r\nThere is no obligation to refund monies or exchange tickets if management alters or varies the programme due to events or circumstances beyond its control.\r\n</li>\r\n<li>\r\nThere is no obligation to refund monies or exchange tickets should an event organiser subsequently offer any discount or promotion that makes tickets available at a price lower than that previously paid by any customer.\r\n</li>\r\n<li>\r\nShould you have a complaint about an event that has taken place, we will take this up with the event organiser provided you have contacted us within 7 days of the event taking place. We cannot guarantee any outcome.\r\n</li>\r\n<li>\r\nTickets are not transferable. If not purchased from an authorised outlet, tickets may be declared void and will not guarantee entry to the venue.\r\n</li>\r\n<li>\r\nIf tickets that are despatched by Special Delivery are returned to us as \"addressee unknown\", we reserve the right to cancel the order.\r\n</li>\r\n<li>\r\nWe are accept no responsibility for any personal property.\r\n</li>\r\n<li>\r\nAll of these terms and conditions are governed by English law.\r\n</li>\r\n<li>\r\nTickets may be restricted to a maximum number per person. We reserve the right to cancel tickets purchased in excess of this number.\r\n</li>\r\n<li>\r\nWe reserve the right to cancel any tickets we believe to have been purchased fraudulently.\r\n</li>\r\n<li>\r\nOur ts and cs are in line with guidelines offered by the Office of Fair Trading. Please <strong>view this document on their website</strong> before purchasing your tickets to ensure you are happy with our terms and service.\r\n</li>\r\n</ol>\r\n</p>\r\n<p>\r\n<h4>Our liability</h4>\r\nThe material displayed on our site is provided without any guarantees, conditions or warranties as to its accuracy. To the extent permitted by law, we, and third parties connected to us hereby expressly exclude:\r\n</p>\r\n<p>\r\n<ul>\r\n<li>All conditions, warranties and other terms which might otherwise be implied by statute, common law or the law of equity.</li>\r\n<li>Any liability for any direct, indirect or consequential loss or damage incurred by any user in connection with our site or in connection with the use, inability to use, or results of the use of our site, any websites linked to it and any materials posted on it, including, without limitation any liability for:</li>\r\n<li>loss of income or revenue;</li>\r\n<li>loss of business;</li>\r\n<li>loss of profits or contracts;</li>\r\n<li>loss of anticipated savings;</li>\r\n<li>loss of data;</li>\r\n<li>loss of goodwill;</li>\r\n<li>wasted management or office time; and</li>\r\n</ul>\r\n</p>\r\n<p>\r\n<small>\r\nfor any other loss or damage of any kind, however arising and whether caused by tort (including negligence), breach of contract or otherwise, even if foreseeable, provided that this condition shall not prevent claims for loss of or damage to your tangible property or any other claims for direct financial loss that are not excluded by any of the categories set out above\r\n</small>\r\n</p>','Y');
