INSERT INTO `event_master` VALUES ('1','Movie Video and Screen Awards','movie-video-and-screen-awards','The 9th Annual Movie Video and Screen Awards returns to the ICC Birmingham on Sat 31st October. The event will be hosted by Danny John Jules best known for his role as the cat in Red Dwarf and Suzanne Packer from the BBC1 Series Casualty. The awards honour exceptional talent from Television and the film Industry.','The 9th Annual Movie Video and Screen Awards returns to the ICC Birmingham on Sat 31st October for another gala evening with Television and Films biggest stars\r\nThis flamboyant evening of fine dining and exhilarating performances and of course the awards ceremony is one the must not be missed. This year awards will be hosted\r\nBy Danny John Jules known for his role in the BBC 1 Drama Death in Paradise and Casualty Actress Suzanne Packer with performances from some of the UK top\r\nrecording Artiste for more information go to www.biffestival.co.uk','2015-10-31 18:30:00','0000-00-00 00:00:00','ICC','1B Broad Street','Birmingham B1 2EA','','United Kingdom','assets/images/main-thumb.jpg','.jpg','.jpg','.png','event_img_1_thumb1.jpg','event_img_1_thumb2.jpg','event_img_main_carousel_1_thumb1.jpg','event_img_recommended_carousel_1_thumb1.png','5.00','','','Y','Y','Y','Y','','','','','0000-00-00 00:00:00','2015-10-31 15:22:37','N'),('2','SOUTHPORT FAMILY DAY TRIP','southport-family-day-trip','Loyal Mizpah presents the Annual Summer` Family Day Trip to the sunny seaside city of Southport. The city makes the ideal escape from the hustle and bustle of the big city. It has over 22 miles of coastline boasting a number of beautiful beaches and stunning natural beauty and has one of the oldest piers in the UK, stretching proudly across Southport beach, when you arrive your day will be pack with fun activities for the whole family. You can go to the theme park, enjoy a game of dominoes or indulge in a bit of retail therapy, why not try have afternoon tea at one of the many seaside restaurants. or If you prefer something more up market you can go to one of the many seaside bars for a glass of Wine, Prosecco or Champagne. Then join us for the afternoon party with Dean Alexander, Mr Smooth and guest . its a day you wont forget. More info call 07958 795 902','Loyal Mizpah presents the Annual Summer` Family Day Trip to the sunny seaside city of Southport. The city makes the ideal escape from the hustle and bustle of the big city. It has over 22 miles of coastline boasting a number of beautiful beaches and stunning natural beauty and has one of the oldest piers in the UK, stretching proudly across Southport beach, when you arrive your day will be pack with fun activities for the whole family. You can go to the theme park, enjoy a game of dominoes or indulge in a bit of retail therapy, why not try have afternoon tea at one of the many seaside restaurants. or If you prefer something more up market you can go to one of the many seaside bars for a glass of Wine, Prosecco or Champagne. Then join us for the afternoon party with Dean Alexander, Mr Smooth and guest . its a day you wont forget. More info call 07958 795 902','2015-07-18 06:00:00','0000-00-00 00:00:00','Various','Southport City','Southport','','United Kingdom','assets/images/family.png','.png','','','event_img_2_thumb1.png','event_img_2_thumb2.png','','','0.00','','https://www.youtube.com/embed/RlgOoZJ4FNo','Y','Y','Y','Y','','','','','0000-00-00 00:00:00','2015-09-12 19:31:20','N'),('3','Rick Clarke Birthday Summer Ball','rick-clarke-birthday-summer-ball','London Elite Presents The Rick Clarke Birthday Black & White Dinner and Dance on <br/>\r\nSATURDAY 1ST AUGUST 2015 To Be Held at the 4 STAR KENSINGTON CLOSE HOTEL, <br/> \r\nLONDON W8 5SP 3 COURSE DINNER, COMEDY & MUSIC BY 5TH AVE; NIGEL B SPECIAL TOUCH; PC MISTRI; FEDERAL TOUCH  Hosted by Gilly Gil <br/>\r\nDINNER & DANCE 49 <br/>\r\nOR FOR DANCE ONLY TICKETS 20 <br/>\r\nCALL O2O78541112    RICK 07956564420    WINNIE 07956801660    GILLY 07712706698 <br/>\r\n7.30pm drinks reception ~ 8pm dinner ~ 10pm show & dance','London Elite Presents The Rick Clarke Birthday Black & White Dinner and Dance on <br/>\r\nSATURDAY 1ST AUGUST 2015 To Be Held at the 4 STAR KENSINGTON CLOSE HOTEL, <br/> \r\nLONDON W8 5SP 3 COURSE DINNER, COMEDY & MUSIC BY 5TH AVE; NIGEL B SPECIAL TOUCH; PC MISTRI; FEDERAL TOUCH  Hosted by Gilly Gil <br/>\r\nDINNER & DANCE 49 <br/>\r\nOR FOR DANCE ONLY TICKETS 20 <br/>\r\nCALL O2O78541112    RICK 07956564420    WINNIE 07956801660    GILLY 07712706698 <br/>\r\n7.30pm drinks reception ~ 8pm dinner ~ 10pm show & dance','2015-08-01 06:00:00','0000-00-00 00:00:00','Kinsinton Close Hotel','Wrights Lane off Kensinton High Street','London W8 5SP','','United Kingdom','assets/images/mimg01.png','.png','','','event_img_3_thumb1.png','event_img_3_thumb2.png','','','0.00','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2483.805394215012!2d-0.19167989999999246!3d51.49843857908681!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0:0x53895c357f70187f!2sKensington+Close+Hotel!5e0!3m2!1sen!2s!4v1435911077833','','Y','Y','Y','Y','','','','','0000-00-00 00:00:00','2015-09-12 19:23:10','N'),('4','SPECIAL REQUEST DANCEHALL EDITION','special-request-dance-hall-edition','Cloud 9 and GNO Present its a Dancehall Special Request\r\n<br/>\r\nA Bank holiday  Dancehall special with some of the top Dancehall DJS in the midlands throw down some of the hottest tracks of the Genre whilst being supported by the freshest talented DJs of the last year to give you that RnB, Hip Hop and house to give you that bank holiday raving  feel.\r\n<br/>\r\nHosted at Sugarsuite, Broad St the ultimate party venue you can buy a Sugarsuite round or Book a VIP booth.  \r\n<br/>\r\nFor information on Birthdays, Group packages or VIP go to info@goodnightsoutuk.com or cal 07500693619\r\n<br/>\r\nDJS\r\n<br/>\r\nMr Lenn\r\n<br/>\r\nX - Ta - C 4 x 4\r\n<br/>\r\nAsher Ray \r\n<br/>\r\nDJ Matchu \r\n<br/>\r\nDay Day \r\n<br/>\r\nMC Q \r\n<br/>\r\nSmart Dress Essential (uptown style)\r\n<br/>\r\nNo Sportswear','Cloud 9 and GNO Present its a Dancehall Special Request\r\n<br/>\r\nA Bank holiday  Dancehall special with some of the top Dancehall DJS in the midlands throw down some of the hottest tracks of the Genre whilst being supported by the freshest talented DJs of the last year to give you that RnB, Hip Hop and house to give you that bank holiday raving  feel.\r\n<br/>\r\nHosted at Sugarsuite, Broad St the ultimate party venue you can buy a Sugarsuite round or Book a VIP booth.  \r\n<br/>\r\nFor information on Birthdays, Group packages or VIP go to info@goodnightsoutuk.com or cal 07500693619\r\n<br/>\r\nDJS\r\n<br/>\r\nMr Lenn\r\n<br/>\r\nX - Ta - C 4 x 4\r\n<br/>\r\nAsher Ray \r\n<br/>\r\nDJ Matchu \r\n<br/>\r\nDay Day \r\n<br/>\r\nMC Q \r\n<br/>\r\nSmart Dress Essential (uptown style)\r\n<br/>\r\nNo Sportswear','2015-08-30 00:00:00','0000-00-00 00:00:00','Sugar Suite','200 Broad St','Fice Ways Bimingham B15 1SU','','United Kingdom','assets/images/cloud-nine-bg.jpg','.jpg','.jpg','','event_img_4_thumb1.jpg','event_img_4_thumb2.jpg','event_img_main_carousel_4_thumb1.jpg','','0.00','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.2058433426973!2d-1.9138237!3d52.4754086!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bcf638654fa7:0x1684de4c80951199!2sSugar+Suite!5e0!3m2!1sen!2sin!4v1439744783919','','Y','N','N','N','','','','','0000-00-00 00:00:00','2015-09-20 05:38:41','N'),('5','After Party - Movie Video and Screen Awards','after-party-movie-video-and-screen-awards','After a great night out at the MViSA Awards why not join us for the ultimate exclusive celebrity party in the UK. This year as its Halloween, we have teamed up with Bottega to host the ultimate Masquerade party. This means all you have to do is add a mask to your beautiful awards outfit and you will be ready to dance the night away. Do not worry if you forget yours as they will be available on the night. Surrounded by plush luxury at one of the most exclusive venues in the city, you will enjoy mixing and mingling with all the celebrities from the awards. <br/>\r\nTickets are limited and purchase tickets are only valid when accompanied by an awards ticket, so if you dont have an MViSA Awards ticket.  DO NOT PURCHASE an after party ticket..  <br/>\r\nMusic will be provided by the Stoneheart Family, DeanAlexander and Guest Djs.','After a great night out at the MViSA Awards why not join us for the ultimate exclusive celebrity party in the UK. This year as its Halloween, we have teamed up with Bottega to host the ultimate Masquerade party. This means all you have to do is add a mask to your beautiful awards outfit and you will be ready to dance the night away. Do not worry if you forget yours as they will be available on the night. Surrounded by plush luxury at one of the most exclusive venues in the city, you will enjoy mixing and mingling with all the celebrities from the awards. <br/>\r\nTickets are limited and purchase tickets are only valid when accompanied by an awards ticket, so if you dont have an MViSA Awards ticket.  DO NOT PURCHASE an after party ticket..  <br/>\r\nMusic will be provided by the Stoneheart Family, DeanAlexander and Guest Djs.','2015-10-31 18:30:00','0000-00-00 00:00:00','Secret Location','City Centre','Birmingham B1','','United Kingdom','assets/images/afterpartyevent.jpg','.jpg','.jpg','','event_img_5_thumb1.jpg','event_img_5_thumb2.jpg','event_img_main_carousel_5_thumb1.jpg','','5.00','https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d4860.147259508455!2d-1.905823049999954!3d52.477802549999986!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1scity+centre+near+Birmingham+B1,+United+Kingdom!5e0!3m2!1sen!2sin!4v1441331466428','','Y','N','N','Y','','','','','0000-00-00 00:00:00','2015-10-31 15:26:40','N'),('6','Giants of lovers rock','giants-of-lovers-rock','Giants of lovers rock','Giants of lovers rock','2015-10-23 00:00:00','0000-00-00 00: