 Saturday 7th November 2015, departing from Holyhead Road, Handsworth  Arrival at 7:00am leaving at 7:15am Prompt! Going to Cheshire Oaks Designer Outlet, Ellesmere Port, Cheshire CH65 9JJ. We aim to arrive before shops open and intend to arrive back no later than 8pm.  Allowing you enough time to shop. There are several restaurants and take away outlets on site.','2015-11-07 00:00:00','2015-11-07 00:00:00','Cheshire Oaks Designer Outlet','Ellesmere Port','Cheshire','','Cheshire','','.jpg','.jpg','','event_img_13_thumb1.jpg','event_img_13_thumb2.jpg','event_img_main_carousel_13_thumb1.jpg','','0.00','https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d9545.069122596904!2d-2.8798232!3d53.2668305!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0:0xaafc633d50f2e8d!2sCheshire+Oaks+Designer+Outlet!5e0!3m2!1sen!2sin!4v1443544986910','','Y','N','N','N','','','','','0000-00-00 00:00:00','2015-09-29 23:16:26','Y'),('14','Caribbean eXperience','caribbean','On Friday 27 Nov, as we host a special Caribbean Evening at the Holte FRI 27 Nov, from 6:45pm\r\nThe Caribbean eXPERIENCE \r\nHolte Suite Aston Villa Football Grounds. Trinity Road Aston Birmingham \r\n\r\nRum Punch Reception 7:00pm \r\nDinner will be served from 8pm \r\nEvening Presentation from 8:30pm\r\nNetworking 10:00 \r\nEvening Ends : 10:30','Virgin Atlantic and Diamond Travel invite you to join them from 6:45pm on Friday 27 Nov, as we host a special Caribbean Evening at the Holte Suite Aston Villa. Come and experience one of the true wonders of the world which is the Caribbean in its splendour,  With an evening of Cocktails, Caribbean fine Dining and Entertainment with special celebrity guest on the evening, the two time MViSA Award winning actor Rudolph Walker OBE','2015-11-27 00:00:00','2015-11-27 00:00:00','Holte Suite','Villa Park Trinity Road, Aston, Birmingham B6 6HE','Birmingham','','England','','.jpg','.jpg','','event_img_14_thumb1.jpg','event_img_14_thumb2.jpg','event_img_main_carousel_14_thumb1.jpg','','0.00','https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d2428.350473520599!2d-1.8866605841929493!3d52.5089961798121!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2suk!4v1447001424738','','Y','N','N','Y','','','','','0000-00-00 00:00:00','2015-11-08 17:02:03','Y'),('15','MOVIE VIDEO & SCREEN AWARDS 2016','mvsa','The UK\'s biggest screen awards for people of colour celebrates 10 years','29th October 2016 will see the return of the UK\'s biggest screen awards for people of colour celebrates 10 years,','2016-10-29 18:30:00','2016-10-29 18:30:00','ICC','Broad Street','Birmingham','','United Kingdom','','','.jpg','','','','event_img_main_carousel_15_thumb1.jpg','','0.00','','','Y','N','N','Y','','','','','0000-00-00 00:00:00','2015-11-08 19:02:21','Y');
